import React from "react";
import {　BrowserRouter as Router,　Switch,　Route} from "react-router-dom";
import Home from "./components/Home";
import Congrats from "./components/Congrats";
import Again from "./components/Again";
import './App.scss';

function App(props) {
  return (
    <>
      <Router>
        <div>
          <Switch>
            <Route path="/congrats">
              <Congrats />
            </Route>
            <Route path="/again" component={Again}>
              <Again />
            </Route>
            <Route path="/">
              <Home titlename="ホームだよ" />
            </Route>
          </Switch>
        </div>
      </Router>
    </>
  );
}

export default App;
